### Description
Added a class ```PatternGraph``` to abstract the match of subgraph. Along with it, we also added some other class to help to construct pattern graph, including ```PGraphNode```, ```PGraphInput```, ```PatternMatchResult``` , ```PGraphInputShapes``` and ```PGraphInputTypes```. Besides, some unit tests were added to verify the algorithm.

### Motivation and Context
In ONNX Runtime, there are many code used to match a certain subgraph of a model and make some changes correspondingly, such as fusion, elimination, etc. So far, the way to deal with it is to write code for every kind of subgraph that we want to find and manipulate. In this way, some logic are duplicated and the code is too long to take an easy review. As we can see, there are many independent files in path ```onnxruntime/core/optimizer```.

Pattern graph is an abstract of the matching progress above. It makes us be able to define a certain kind of subgraph with some strings and simple methods. It provides a method to match the target graph and return user the matching result.

### Usage & Example

Pattern graph is actually a class named ```PatternGraph``` which is defined in onnxruntime. Besides, ```PGraphInput``` and ```PGraphNode``` are defined to describe the args and nodes in a certain subgraph (pattern).

The basic usage is like the code below.

```
PGraphInputTypes float_type(TypesCategory::AllFloatTensorTypes);
PatternGraph pattern(
    {
        PGraphInput("C1", float_type),
        PGraphInput("C2", float_type),
        PGraphInput("X", float_type)
    },
    {
        PGraphNode("Exp", {"X"}, {"Y"}, "p_exp"),
        PGraphNode("Add", {"Y", "C1"}, {"Z1"}, "p_add1"),
        PGraphNode("Add", {"Y", "C2"}, {"Z2"}, "p_add2"),
        PGraphNode("Sub", {"Z1", "Z2"}, {"W"}, "p_sub")
    });
```

It represents the simple subgraph below.
```
        |
       Exp
     /     \ 
   Add     Add
     \     /
       Sub
        |
```

Firstly, we defined three args, which are X, C1 and C2. The type constraint of them is float, which contains FP32, FP64, FP16 and BFP16. Then we defined four nodes. The first parameter is the OpType of the node. The second parameter is the input args of the node and the third is output args. The last parameter is the node's name.

In fact, there are more optional parameters of ```PGraphInput``` and ```PGraphNode```, but here we simplify it and just show the form of expression of ```PatternGraph```.

Then let's assume that there is already a target graph which contains the subgraph described above. The code below shows how we find a match for it.

```
PatternMatchResult res(target_graph);
Status status = pattern.TryMatch(target_graph, res);
```

The result of the matching is pairs which contain the index of node in target graph and corresponding node in pattern graph. When the pattern graph tries to find a match, it will use ```GraphArgumenter``` to generate an onnx graph at first and maintain it. This point is important because sometimes we may need to replace the nodes according to the relationship between nodes and the onnx graph makes it easy to iterate.

If we only want to change the ```Sub``` node to ```Add```, the pseudo code is like below.
```
auto old_node = res.GetNodeByName("p_sub");
// RemoveNode(idx);
// AddNewNode("Add");
```

### Design & Details

We use ```PGraphInput``` and ```PGraphNode``` to let users define node args and nodes they want to match respectively. The two classes will convert the user inputs to ```NodeDef```, which makes it possible for us to generate onnx graph with ```GraphAugmenter```.

The constructor of ```PGraphNode``` is shown below. In ```PGraphNode``` constructor, users could also specify accepted versions, domains and attributes for a pattern. If the user specify the  domain_version_maps with ```{{kOnnxDomain, {1, 13}}}```, then the node in target graph won't be matched if it is another version, even though all the other things are matched.

```
  PGraphNode(const std::string& op_type,
             const std::vector<std::string>& input_args_names,
             const std::vector<std::string>& output_args_names,
             const std::string& node_name = "",
             const std::unordered_map<std::string, std::vector<int>>& domain_version_maps = {},
             const std::vector<AttributeProto>& attributes = {},
             int output_edges_count = 0);
```

The constructor of ```PGraphInput``` is shown below. As you can see, there are two constructors but the only difference is that one use ```shape``` and the other use ```rank```.

The design above lets users to specify some properties for matching. But in practice, the condition may be much more complex. For example, the user may want to match a node that "is version 13 of Add operation or domain microsoft of Layernorm operation". Or the user may want to match a node that "between node A and node B and its output links to a certain subgraph".

If we abstract all the possible constraints that the user may ask for, it will bring a lot of trouble for users who do not need them. So we add ```CustomizedConstraint``` for ```PGraphNode``` and ```PGraphInput```. The delegate function has the format below:
```
class NodeCompareFunc {
 public:
  virtual bool operator()(const Node* g, const PGraphNode* p, const Graph& /*target*/, const PatternGraph& /*pattern*/) const = 0;
};

class ArgCompareFunc {
 public:
  virtual bool operator()(const NodeArg* g_arg, const PGraphInput* p_arg, const Graph& /*target*/, const PatternGraph& /*pattern*/) const = 0;
};
```

We provide the node in target graph and pattern, along with target graph and pattern graph for users to define their own constrains. The constraint could be added to a certain node/arg or directly replace the default constraint.

```
class CustomNodeCompareFunc : public NodeCompareFunc {
public:
bool operator()(const Node* g, const PGraphNode* p, const Graph& target,
                const PatternGraph& /*pattern*/) const override {
    return !(p->NameEquals("p_add")) || GraphParser::HasSingleSpeciefiedConstantValue(target, g, .0);
}
};
pattern.SetCustomConstraint(std::make_unique<CustomNodeCompareFunc>());
```

In the code above, we make an customized constraint replace the default constraint. If we only want the constraint be added to a certain node, it could write the code below.
```
pattern.SetCustomConstraint(std::make_unique<CustomNodeCompareFunc>(), "NodeName");
```



### Matching algorithm

We use recursion to find a match for a pattern. If we think node ```T``` (of target graph) and node ```P``` (of pattern graph) are matched, they must satisfy two requriments.

1. ```T``` and ```P``` have same properties, including optype, version, domain and so on.
2. All the neighbor nodes of ```P``` could find a match among neighbor nodes of ```T```.

Therefore, we compare the properties of the current two nodes and then call the match function itself again to see if all the neighbors of P could find a match. We use hash table to record the node that we have visited to avoid infinite loop.

It worth noting that we provide an optional parameter ```root_node``` to let users define the start node of matching. That's because starting from a suitable node could reduce the recursion depth of matching algorithm. If the user does not specify the parameter, we will choose the node with minimum index to start with.
